import React, {Component} from 'react';
import OurValuesItem from './OurValuesItem';
import SeoTitle from '../Title/SeoTitle';
import { translate } from "react-translate";


class OurValues extends Component{
    render(){

        let {Â t } = this.props;
       
        return(
            <section className="security_features_area breadcrumb_area">
                <div className="container">
                    <div className="hosting_title security_title text-center">
                        <SeoTitle Title={t(this.props.title_v)}/>
                    </div>
                    <div className="security_features_inner">
                        <OurValuesItem image="rocket.png" Title={t(this.props.value1)}/>
                        <OurValuesItem image="shield.png" Title={t(this.props.value2)}/>
                        <OurValuesItem image="real-estate.png" Title={t(this.props.value3)}/>
                    </div>
                </div>
            </section>
        )
    }
}

export default translate('values_about')(OurValues);
